import React from "react";


function LaptopList() {
    return (
        <div>
            <h1>Laptop List</h1>
            <p>First Laptop</p>
            <p>Second Laptop</p>
            <p>Third Laptop</p>
            <p>4th Laptop</p>
        </div>
    );
}


export default LaptopList;
